// import './img'

import './Footer.css';

// import search from './img/search.svg'


function Footer() {
    return (
        <div className="footer">
           <div className='logo_footer'>
               <h1>Tho Tran</h1>
               <hr/>
               <div className='footer_menu'>
                <ul>
                    <li className='footer_menu_itemt1'>
                        <img  alt=''/>
                    </li>
                    <li className='footer_menu_itemt2'></li>
                    <li className='footer_menu_itemt3'></li>
                    <li className='footer_menu_itemt4'></li>
                    <li className='footer_menu_itemt5'></li>
                    <li className='footer_menu_itemt6'></li>
                    <li className='footer_menu_itemt7'></li>
                    <li className='footer_menu_itemt8'></li>
                </ul>
               </div>

           </div>
        </div>
    );
}

export default Footer;
